import React, { useContext } from 'react';
import { DataContext } from '../Contexts/dataContext'
import { DataProvider } from '../Contexts/dataContext'

export default function () {
    const [isWeightHeight, setWeightHeight] = useContext(DataContext)
    return (
        <>
            <DataProvider>
                <div>
                    <div>
                        {isWeightHeight.map((value) =>
                        (
                            ((value.height != null && value.weight != null) || (value.height !== 0 && value.weight !== 0)) ?

                                <>

                                    <p>{value.height}</p>
                                    <p>{value.weight}</p>
                                    <p>{value.date}</p>
                                    <p>{value.bmi}</p>



                                </>
                                :
                                <>
                                    {/* {console.log(value)}
                                         {console.log(value.height)}
                                         {console.log(value.weight)} */}
                                </>
                            // console.log(value)
                        ))
                        }
                    </div>
                </div>

            </DataProvider>
        </>
    );
}
